#include<iostream>
#include<vector>
#include<map>
using namespace std;
class Solution {
public:
    int numIslands(vector<vector<char>>& grid) {
        uint16_t count = 0;
        vector<std::pair<int,int>> q {}; 
        map<std::pair<int,int>,bool> explored;
        for(int m = 0; m < grid.size(); m++){
            for(int n = 0; n < grid[0].size(); n++){
                if(grid[m][n] == '0' || explored[{m,n}]) continue;
                q.push_back({m,n});
                count++;
                while(!q.empty()){
                    std::pair<int,int> p = q.back();
                    int i = p.first, j = p.second;
                    q.pop_back();
                    if(!explored[{i,j}]){
                        explored[{i,j}] = true;
                        if(i-1 >=0 && grid[i-1][j]=='1' && !explored[{i-1,j}])
                            q.push_back({i-1,j});
                        if(i+1 < grid.size() && grid[i+1][j]=='1' && !explored[{i+1,j}])
                            q.push_back({i+1,j});
                        if(j-1 <= 0 && grid[i][j-1]=='1' && !explored[{i,j-1}])
                            q.push_back({i,j-1});
                        if(j+1 < grid[0].size() && grid[i][j+1]=='1' && !explored[{i,j+1}])
                            q.push_back({i,j+1});
                    }
                }
            }
        }
        return count;
    }
};
